          <Paragrafo>+ Conquiste o seu publico e outras turmas</Paragrafo>
          <Paragrafo>+ Tenha visibilizade</Paragrafo>
        </FundoBalao>
      </TamanhoDivImg>
      <div>
        <button onClick={login}>Entrar</button>
        <button onClick={register}>Entrar</button>
      </div>
    </Container>
  );
}
